INSERT INTO `artical` VALUES (1,'书法鉴定方法','收藏知识','书法鉴定的方法与技巧归纳起来有：一是了解每位代表书家的书风特征，用笔习惯，个性特点以及师承渊源。二是了解各地区，各书家的作伪方法和形式。三是鉴定者必须自己临习书法，了解书法的一般技法与审美特质。在具体书法鉴定时，凡运笔唐突、墨色灰黯、结体杂乱，且气韵不佳、气脉不通、气息不纯的作品，便应引起重视。在用笔上，多注意挑、勾、撇、捺的起、收笔和转折处是否自然合理，用笔的藏与露、方与圆，用墨的浓与淡、枯与竭，结字的松与紧、疏与密都要用心观察，尤其是首字和尾字更应该注意。章法上要注意邻近字的关系、行间和竖间的距离是否舒适得体，全篇章法布局是否和谐统一。此外还应摸清作伪者与被作伪者的关系和本质区别，以便鉴定时作参照现代书法作伪的方法很多，除了利用高科技，如用电脑和写真机，高倍的实物投影仪，精焦距的幻灯机将原作投放在壁面上，而后请人描绘作伪，更多的是请一些已故名家子女代笔或一些私承弟子作伪。这些人一般比较熟悉被仿对象的书体特征、书法风貌、笔法特点。画商们出一定的价格，请作伪者仿写，其数量有的几幅，甚至成批，而后加盖留存下来的印章。无印章者，一般将高清晰出版物或原作上的印章制成锌版，更有的用电脑制作，经处理后钤盖。书法作品利用木版水印冒充作伪或利用出版物作伪，较之绘画来说相对较少，主要是因为木版水印需相当的成本，经济上划不来。再者，书法作品比绘画作品鉴定真伪相对来说要简单。现代书法作伪明显带有区域性作伪的特征。如齐白石、徐悲鸿的伪作大多来自北京；沙孟海、陆俨少的伪作大多来自杭州，李叔同、吴湖帆、沈尹默等人的伪作则在上海。有些名家书法的作伪则遍布全国了，如黄宾虹、于右任、张大千、章太炎等，其仿作遍布北京、上海、杭州，甚至在广州、海南等地亦有人作伪。一般来说，鉴定传统的书法作品相对于绘画作品要复杂些，其线条的运行、章法的布局、款识与钤印的特点有时令鉴定者无从下手。而鉴定现代书法作品则比绘画作品要简单些，主要是现代书家离我们较近，人数虽然也不少，但与古人相比要少得多，而且都集中在一个较短的时间段。较容易找其原作、相关资料进行比照；再者作伪者的水平，比古代人要差得多，无论是笔墨技巧还是书外学养跟古人比都有差距。总之，书法鉴定是多因素的，除了笔法、墨法、章法，书法本身，还要对纸张、装裱等其它材料和工艺进行综合的分析，才可定断书法的真伪。','2017-08-09 15:50:47',NULL,NULL),(2,'和田玉的一些保养方法',NULL,'和田玉贵为“国玉”，到手之后每个人都它都是爱护有佳，在这里小编给出大家一些和田玉保养的知识供大家参考。 1：玉件到手，先用常温清水浸泡2－3个小时（待表面附着物软化），然后用牙刷刷洗干净，再放入热水（新玉约70、80度左右，老玉约50、60度左右）中浸泡，浸泡到热水与玉慢慢自然冷却，通常我都会置于空气不流通的保温场所，让热水徐徐冷却。也籍此让玉的毛细孔得到充分的舒张，将内部污垢吐干净。如此进行约3个循环，之后大约每3个月到半年进行1次，夏季则约1到2个月进行1次。 2：第二天开始盘玩，（请注意不让玉器直接接触肌肤），闲暇时可拿在手上盘玩，但记得手是干净的。还有平时千万记得不要把玉器放在脸上和鼻子上去抹油（经常见到），那油可不是所谓的玉的滋养液哦，反而适得其反会将玉门（毛细孔）封死，使盘出来的玉光泽显得很闷。还有我也不用猪鬃刷，因为刷出来的包浆感觉会带有贼光。在此建议平常可用柔软的”白色纯棉“长毛巾盘，但不宜使用染色布或或化纤性质的硬布料擦拭。 3：在夏季经1个星期（冬季2－3个星期）盘玩后，每天晚上洗澡时用温清水（约40度），先浸泡一段时间再刷洗干净，请注意千万避免与肥皂直接接触，之后就只要常保持玉件的清洁即可。如方便也可常洗刷，众所周知，汗液带有盐分、挥发性脂肪酸及尿素等。玉件接触太多的汗，佩戴后又不即刻清理干净，时间一长玉件便会受到侵蚀，外层受损，影响原有的光泽度。尤其是白玉，更忌汗和油脂。白玉若过多接触汗液则容易变成淡黄色，不再纯白如脂。 请注意玉最忌讳以下物质――香水、化学剂、肥皂和人体汗液。 经过一段时间的盘玩，玉件本身的质地会渐渐地显露出来，好的玉温润有余，灵气十足，且会越看越赏心悦目！','2017-08-13 08:13:27',NULL,NULL),(3,'识别真假紫砂只需3分钟',NULL,'“假紫砂壶在市场上已经盛行多年，只是现在才暴露出来而已。”对于媒体对假壶的炮轰，陶醉轩紫砂艺术体验馆觉得并不惊讶。 据介绍，在业内，所谓假紫砂壶包括两种：一是假泥，二是假款。假泥就是用化工泥替代紫砂泥。假款一是有些工艺师在壶上盖自己的章却找人代工；二是作假者冒用名家的印章。“如果算上假泥和假款，现在市面上90%的紫砂壶都是假的。” “紫砂壶最基础的是泥料，最混乱最有危害的也是泥料。”一名紫砂壶收藏爱好者告诉记者，假泥壶一般进不了收藏界，而且厦门纯粹玩收藏的并不多，大多数人还是作为泡茶使用，如果是假泥壶，会直接对人体造成伤害。 据观察，现在市场上存量最多、存在时间最长的是一种手拉胚的假壶。“紫砂泥的特性决定了它没办法手拉成型，只能是打泥片。”手拉胚壶往往以全手工的面目示人，但这种壶的泥料其实是普通陶土加化工原料。 “在宜兴，这种壶一个工人一天能做两三百个，价格也就在10元到30元之间。”说，这种壶的壶内都留有一环环的线条痕迹，懂行的识别起来很简单。 真壶售价两三百元合理 一位业内人士告诉记者，在上世纪80年代，紫砂壶的最大市场在东南亚、台湾、福建、广东一带，厦门曾是当时紫砂壶的最大集散地，现在厦门民间还有不少老壶。而紫砂壶收藏热在大陆的真正兴起也就在最近几年。 “现在紫砂壶的市场需求量扩大了几百倍，价格也随之上涨了四五倍。”该人士说，紫砂壶价格的上涨是合情合理的，只是涨得有点快，已经形成了一定的泡沫。 那么，一把真正的紫砂壶到底能值多少钱呢？ “一把壶一般需用1斤泥料，即使差点的泥料也要几十元，还要加上人工、包装、运费，还有烧制过程中的废品损耗等。因此学徒或普通工人制作的普通壶，一把售价在两三百元是比较合理的。”表示。 也就是说，如果一把紫砂壶的售价低于200元的话，那十有八九是假货。 而对于那些好的紫砂壶来说，价格就完全不一样了。“现在稍微有点名气的工艺师制作的紫砂壶，一把进价至少要1000元。”说，这种紫砂壶已经算是工艺品，其价值主要看工艺师制作水准，而泥料所占的成本最多不超过10%。 而真正由名家制作的手工紫砂壶，目前在市场上更是炒到了几十万元乃至上百万元一把。 识别真假紫砂壶只需三分钟 对于很多市民来说，紫砂壶可能透着神秘。介绍说，其实如果掌握了方法，只需花个三两分钟即可辨别真假。 一是看。首先看表面。由于是陶土而且不上釉，新的紫砂壶表面不可能是光亮的，而是有粗糙感。而假泥壶为了卖相好，一般会打蜡抛光。其次，紫砂泥中含有石英、云母等微量元素，在高温烧制中会形成结晶体，因此在光亮下，整个壶身能看到很多细微的银白色亮点。第三，真正的紫砂壶壶内外颜色几乎是一致的，不会相差太大。 二是用开水试。将刚烧开的水倒进壶内并沿着壶身浇下，盖上壶盖。你会看到水不是顺着往下流，而是被慢慢吸干；壶盖上则先是慢慢湿润，而后又慢慢吸干。这是紫砂壶拥有双层气孔，透气性好的表现。 三是将泡好的茶留在茶壶内，两三天内茶不会变馊。 还特意介绍说，用壶盖敲壶身听声音的鉴别方法其实是不科学的。因为造型、泥料的不同，声音也会不一样。而且假泥中加入玻璃水等也可以敲出真泥类似的声音。敲击听声音的更大功效在于辨别壶身有没有隐藏的裂痕。','2017-08-13 08:15:40',NULL,NULL),(4,'三点鉴定真玉',NULL,'有很多选购玉器的消费者都不知道怎样去鉴定玉器的真假，唯一的方法就是到玉器专卖店选购和看玉鉴定的证书，但人心叵测，有些专卖店也会有假玉销售。所以最好的方法就是自己识得怎样去鉴别真假玉。 下面就来说说怎么进行手链的玉鉴定吧。玉手链一般配戴在手腕部位，以祈求平安，镇定心志和美观为主要用途。和田玉手链一般由新疆和田子玉料琢制而成，呈卵石状，玉质温润、色泽柔和，佩戴这种玉器具有舒适高雅的效果。进行玉鉴定的第一个首要就是证书，正规的珠宝玉石质量检验证书，一定是国家认定的检测机构。检验证书上一定要印有\"CMA\"、\"CAL\"、\"CNAL\"三个标识中的任一个标识。看一下是否具有这三个标识。 其次看其纹路：玉不可能无暇，所以玉不一定就是十全十美的，有的玉含有少量杂质，真的玉纹路清晰，大部分纹路不是纵向的而是横向的，具有一定的石纹可供辨认，而假的玉(如玉鐲)的纵路就如同画上去的一样，比较容易区别。 最后看其亮度和光泽：真玉的亮度、光泽都不错，好的玉器其色泽肯定是光泽的，和田玉的光泽是一种介于玻璃光泽、油脂光泽和腊状光泽之间的玉特有的光泽，看起来有一种天然的玉特有的灵性，当然水料的光泽比山料的光泽要好，假玉的亮度明显不够，看起来很暗，光泽也很差劲。 鉴定的准确度还要和平时的经验积累相结合的。','2017-08-13 08:15:40',NULL,NULL),(5,'保管字画的简易方法',NULL,'私人收藏字画由来已久。但如何保管好字画使其艺术价值长存，却不是一件容易的事。笔者介绍几种保管字画的简易方法。 字画，不论是立轴、屏、对联、手卷、册页，还是扇面、斗方，基本上属纸质品和丝织品两种，因为都含纤维质，所以具有吸湿性。装裱字画用过的糨糊，含有蛋白质和糖，这又是蠹虫赖以生存的食粮。一幅字画若不精心保管，就很容易遭受各种侵蚀，从而损坏变质。 凡收藏的字画，最好放在封闭的箱、橱、柜内，使字画能拥有一个稳定的有限空间，避免直接受侵蚀和污染。但这并不是说一旦放进去就万事大吉，因为它还是会受到侵蚀的，被虫蛀是常见的一种毁坏现象。大约每年5月左右，随着温度的升高，蠹虫也大量繁殖。防止的办法，可用樟脑丸或上海产的樟脑精块等类药物驱虫。使用时可以将樟脑药放在字画的周围。此药一年之中最好分期放二次，第一次在3至4月，第二次在10至11月，这样防虫效果更好。 放在箱、橱、柜内的字画除放药外，还要做到勤翻动，及时清除不洁之物。每隔半年左右就要展开字画看看，特别是梅雨季节过去之后，最好能分批将字画取出来挂几天进行“晾画”，这样能有效地防止字画生霉。 霉菌在潮湿、温暖和黑暗条件下最易繁殖，因此，字画的贮藏空间的温度应保持在14℃至20℃左右，相对湿度在50%至60%。若室内相对湿度偏高，容易引起纸张受潮而滋长霉菌；而太干燥又容易引起字画的翘曲变脆。一般的家庭遇天气干燥时，可常用湿墩布拖地，或在房内放盆水。天气潮湿时，尤其在雨季，尽量少开窗户，这样可以使房间的湿度得到相应的控制。 长期悬挂在外面的字面，会受到太阳紫外线的辐射，使字画颜色褪淡，字迹模糊，发生纤维的老化、变脆。因此，一般不要将珍贵的字画长期地挂在厅室里，更不要挂在太阳能直射到的地方。应挂一段时间再收藏起来。若字画数量多，则可以采取轮流悬挂的办法。这样做，既能展现收藏字画的不同风格，又能延缓老化变色过程。 尘埃也是字画的大敌之一。挂在墙上，或存放在箱、柜中的字画，同样会受到尘埃的影响，细小的尘埃沾在字画表面，遇到一定的湿度，它会成为不洁净的小颗粒，等小颗粒的水分蒸发，就会在画面上留下黄色斑点。 除此之外，对字画保护还应注意，在欣赏观看时，不要用手指指点点接触画面，更应避免唾沫沾染。展开和收卷时不要将画折坏留下折痕。在收、拿、卷、挂字画时，一定要格外小心，动作要轻。','2017-08-13 08:15:40',NULL,NULL),(6,'画品种及名称',NULL,'书画家把写的字或画的画，经过装荣后，可分为手卷、册页、堂幅、条幅、屏条、横披，对联、扇面等。 1、手卷：就是把书画装裱成卷子，即书画横幅之长者，不适合悬挂，只可舒卷。卷子有大有小，手卷不仅便于案头展阅和临摹，而且适于保管、延长书画的寿命。 2、册页：就是把书画分成页数并裱成册子，称为“册页”。册页一般分为八开、十二开、十六开最多为二十四 开，都是双数。发现有单数者即为残缺，俗称失群册页册页有大有小，最小的册页称为袖珍册页。 3、堂幅：俗称“中堂”因画幅较宽大，适宜悬挂在堂屋中间，故称为“中堂”。 4、条幅：窄于堂幅之直幅谓之“条幅”，特别是窄长的条幅，形如琴者又名“琴条”。 5、屏条：即书画成堂的屏条，常见的有四条、六条、八条、十二条最多为十六条。不能单挂多有四季景或临摹名家的绘画等。 6、横披：即横幅的字或画。 7、对联：俗称对子。两条的字数一样多，上下文辞相呼应。故称“对子”。另外，有“龙门对”，因字多不能直书一行，则写为两行，上条由右而左，头行字多末行字少下条，由左而右，亦头行字多，末行字少，相对挂起，字如“门“字，故称之为“龙门对”。上条和下条均由右面左的一样写法的称之为“顺龙门”。 8、扇面：就是书画家，在扇面上写的手或画的画，故称之为“扇面”。','2017-08-13 08:15:40',NULL,NULL),(7,'玉之极品和田玉',NULL,'和田美玉产于号称“万山之祖”的昆仑山中，闻名古今中外。秦李斯在他的《谏逐客令》中列举了４件稀世珍宝，其中一件即为和田玉。历史上著名玉雕所用的原料也大都是和田玉。现存于北京故宫乐寿堂的我国历史上最大的玉件――《大禹治水图》，重达５３３０公斤，用的也是和田玉并有乾隆皇帝的亲笔题诗。 《天工开物》记载：凡玉……贵重者尽出于阗。和田玉在华夏大地上留下了灿烂的篇章。 和田玉石分为仔玉和山料。河里涝的玉称“仔玉”，质量上乘，但产量低；矿采的叫山料，史书称之为“攻山采玉”，产量较高，只是质量参次不齐。和田玉特别是仔玉主要产在玉龙喀什河和喀拉喀什河，史称白玉河、墨玉河。每当夏洪暴发，河水汹涌澎湃，把玉石矿苗冲刷下来，经过反复磨滚、撞击，杂质尽去，只剩下圆润光滑如凝脂般的宝玉。９月份，洪水过后，河床裸露出来，人们沿着河床仔细地寻玉。其中最珍贵的白玉是羊脂玉，凝如白脂。目前１公斤羊脂玉价值可达１０万多元。如果白玉皮色中杂有琥珀色的斑痕，价值更高。 山料即通过玉矿开采的玉石，主要产在昆仑山中。阿玛斯矿已有几百年的开采史，主要产青玉和白玉。有的矿井灌进雨雪，形成晶莹碧透的冰洞。洞被炸开后，清理出石渣，就沿着蓝色的玉线寻找玉石。玉石不是集中在一起，而是鸡窝状，一般包裹在大理石中，需要进行剥离。此外，还有１９６２年开的和田县玉矿，１９４９年以前开的皮山康西瓦矿。这３个县的玉矿都位于海拔５０００米的昆仑山雪线上，受季节限制严重，一年的开采期只有４个月左右。所以，矿里有句行话：“三年不开张，开张吃三年。”和田玉的价值关键在于质量而不在数量。 和田玉驰名天下，和田玉雕也同样驰名天下。独具特色的和田玉，质地坚硬而细腻，给人以美的感受，用于雕刻已有数千年历史，在国内外享有盛名。 《新唐书》曾记载：德宗即位，遣给事朱如玉之安西，求玉于于阗。得圭一、珂佩五、枕一、带胯三百、簪四十、奁三十、钏十、杆三、瑟瑟百斤，并它宝等。这个朱如玉因中饱私囊，后来被德宗流放到恩州。这是从和田获得玉雕的首次记载，可见唐后期和田已有玉雕业。','2017-08-13 08:16:34',NULL,NULL),(8,'奇石收藏知识',NULL,'一、供石的采集 供石获得的途径,除了流传、购买、交换所得,还可自行采集。采石是一项高尚而有意义的活动,它让你广泛接触大自然,尽情享受山河湖海慷慨的馈赠;它让你在实践中加深对地质科学的理解,增长丰富的感性认识;它让你增强体魄、养身保健、培养耐心、增强毅力、陶冶心性;它让你以石会友、切磋石艺、广泛交流。更重要的是,采石本身就是你石艺创作自我意念的表现当你所得愈广,所获愈丰,采集力、鉴赏力大为提高时,你一定会由衷地赞美采石活动,许多藏石家就是从不经意的偶尔采石到痴迷上奇石艺术的。 (一)山石的采集 岩石破碎为一定块度后,经地下水长时期溶蚀,有的就能形成可供观赏的奇石。它形成后原地保存,并被泥沙埋藏起来,这才能保证不被风化破坏。 要寻找山石类供石,首先应了解所需石种的石脉走向,范围路线也应大致确定。然后到山坡上有形成和保存条件的地段去找，有时在新滑被处更易找到,因为自然力已为我们扒开了复土层。 采集山石应主要采用挖掘的方法,其好处一是可以保存原石的完整性,二是不会破坏自然景观。露头石较易挖掘,深藏石则非得有齐整的装备及较强的人力才能动手。 有的石种,非钢锯、斧凿不能采取,也应抱着谨慎观察的态度。首先要明了是否违反当地政府有关水土保持之禁令,用硬力采集后对当地自然景观是否起到破坏作用,其次是采集的部位、角度要明确,大而无当反不如小而精巧。 (二)江河石的采集 河流的不同地段,所存石头的造型差异很大。上游石系刚从母岩分裂诞生不久,大部分呈多边多角,几何形,阳刚性强烈, 石表过于粗糙。中游石在被水流冲运的过程中,石块间也互相 碰撞磨擦,棱角磨得较为柔和,石肌纹理显示得也比较理想,是江河石采集的最佳地段。下游石因长久的冲滚磨练,大部分形成圆形或椭圆形,有的已形成砂砾。其中圆浑、纹理清晰的卵石 佳品也有不少。 大部分江河石采自于河滩江边,有时需趟着浅水慢慢寻觅。有的小河一到枯水季节就半干洒了,这时就可沿着河底采集。也有的地方在暴雨后反能觅得奇石,这是因为暴雨使得河石松动翻滚,被冲向岸边,露出真容。在小河中觅石要逆水而行,从下游往上游趟水而行,这样可避免河水混淆影响视线。 有的江河石产于河床,须等水位降至一定部位才能发现。比如红河石,河床分为三层,其中以第二层为采集对象,只有到每年十一、十二月份水位降落,那些潜伏于水面之下的美石才会撩开它们的面纱,供人们挑选。 江河石以手捡为主,半埋于河底的石块可用小锹小铲作工具。有的河床石则需用撬、拽、掘的方法。借用的工具有杆棒、绳子、铲子等。运作时一定要注意不要伤及石肤。 为了得到长年藏于水下的河床石,现在有的地方开始采用穿潜水衣水下作业的方式。 一方佳石,那种意外的满足感,定会令你久久难以忘怀。 二、供石的整治与保养 (一)供石的整治 供石的整治,指对新出土的原石进行表面处理。一块新挖出来的石头表面既有泥砂,又有钙质包皮,还有浸泡的杂色、苔藓等。有的江河石、海石则附有青苔水垢、海藻贝类等,这些都需要进行表面的整治。《云林石谱》“灵璧石”条介绍:“石产土中,岁久穴深数丈,其质为赤泥渍满,土人多以铁刃遍刮。凡两三次,既露石色,即以黄蓓帚或竹帚兼磁末刷治。”又,“江华石” 条亦云:“既择绝佳者,多为泥土苔薛所积,以水渍一两日,用磁末痛刷”。 山石的整治方法大同小异,这儿介绍一下昆石和博山文石的整治,余可类推。 昆石开采出来时,周身包裹着红山泥,此时万不可急躁莽动,断然敲击,以免断裂。毛坯采出后,需先曝日西一星期左右,使其山泥干硬,然后浸入清水,使山泥成块剥落,再用清水冲刷。冲刷时应注意剔除石头间隙间的杂质,直至山泥杂质清洗干净为止。考究些的,可用海棠花汁敷于石表,这样可使其黄渍去净,最后再将石放人清水,漂上半个月,使其酸、险成份全部漂清,取出晾干即可。 博山文石新出土时,其表面也沾满了泥浆、附着物,可先用钢丝刷顺其效皱纹路,粗刷一遍,然后可用稀释盐酸冲刷,再用清水冲洗。切记不可用纯盐酸,盐酸浓度比例过高,也会破坏石头表面的效皱。皱纹一旦被破坏,供石的价值也就大为降低。博山文石石表若有黄色钙质附着物,须细心剔除,万不可锤凿斧劈。因为损坏了石头的完整度,也就谈不上供石的观赏性。如黄色附着物一时难以剔除,就将其置于露天,日晒雨淋,风吹露浸,时间一久,它也会风化。再经人工稍加剔除,就会显示出其质朴无华、反瑛归真的自然造型。 江河石、海石的整治相对简单些。一般只需用清水浸泡数小时,再用棕刷或丝瓜筋将其青苔、水垢刷洗掉即可。如渗杂有海藻、贝类等附着物,可使用1:5的稀释冰醋酸浸泡,半天至一天后,即行脱落,然后再反复用清水冲刷漂洗,直到满意为止。 (二)供石的保养 1.石伤养护 供石在采集过程中、运输过程中,常会发生不小心碰破损伤石肤石肌的事。如石伤较明显,可先用金刚石进行打磨,修整,再将原石放置于露天石架。石架最好不用钢铁塑料制品,以水 泥制品为好。原石在石架上经受日晒雨淋,养护者定时浇水,时间一长,石肤自然风化,自然变色,直到整块供石在质感、色感方面完全调和为止,再迁入室内观赏。 2.室外养石 除了有石伤的,其他供石新采集来后也应先在室外供养半年至一年时间,并每日浇水一二次。为了顾及风化度均匀,一个月左右应将供石翻一次面。 3.室内养石 适宜于水盘的供石一般可以用水养的方式。一两天浇水一次,使它经常保持温润而有生气。不宜一直喷水的供石也应经常用干布擦拭,使其保持整洁。 除了水养,有的藏石家喜欢将石油养。他们认为,油养可以保持石之光泽,避免石肤气化、风化。使用的保养油有凡士林、 油腊、上光腊等,用绒布蘸腊、油轻抹轻拭。也有将石腊化成液体后涂刷供石的,效果确也显著。但作为长期保养的供石,其实应该避免上油腊。虽然这类物质在短时期内可以使石之质地、色感更为突出,但也相对阻隔了石头的老化,因为油腊会堵塞石 头的毛细孔,会妨碍石头的呼吸,即妨碍它吸收空气中的养料,使石头久久不能显得老气。而且,上油后的奇石之光泽, 有一种造作感,过重的油腊还会产生反潮现象,致使石之表面变得一片灰白,遮掩了石头的清清面目。总的看来,油养是得不偿失,不值得提倡的。 以上是现代人的养石技巧,再介绍一则古人养石的技巧。明人所著《志雅堂杂抄》云:“以煮酒脚涂灵璧石,其黑如漆,洗之不脱,极妙。”此法是否灵验,不妨一试。 供石的价值高低与其出土流传年份极有关系,时间愈久,石头色泽愈古朴归真,石体会发出成熟的幽光,这种难以确切言传的石表形象,行话称作包浆。包浆愈凝重愈好。包浆的形成,最主要原因当然在于长时期的辗转流传,但藏主的关心爱护也很有关系。俗话说:养石即养心。有的藏石家喜欢将质优肤细 形美的供石置于茶桌书案,在喝茶聊天或阅报看电视时以双手抚摩,使手气、手润通过毛细作用渗入石肤、石体,久而久之,包浆渐起,令人愈加宝爱。 三、供石的陈列 供石无论是作为居家摆饰、案头清供,还是参加展览,列于厅堂,都遇到一个如何陈列的问题。 (一)配置衬具 陈列,首先需要配置衬具。在确定了供石上下正反的位置后,就要考虑衬具的材料、样式、大小等问题。衬具配置得当与否,会影响到供石的美观与意境的显现。衬具大致可以分为木 座、水盘、衬板儿案等几种。清人梁九图在《谈石》一文中认为: “石有宜架以檀跌(按:檀跃,檀木底座也)者,有以储以水盘者,不容混也。檀肤所架,当置之净几明窗;水盘所储,贵傍以回栏曲槛。杂陈违理,贻笑方家矣。” 木座。这是供石最常见的一种底座。它一方面可以陡增供石的典雅气度,另一方面,供石底部的不平、无法置稳的缺憾藉此也得以完满解决。木座的材料以紫檀、红木为上品,蒲松龄 《聊斋志异・石清虚》中就有“雕紫檀为座,供诸案头”之说。黄杨术、袖木、棒木、按木、枣木也不错。术座的雕制是一种雕刻艺术与镶嵌艺术的结合,尤其是楼底,要做到石头坐于上严丝合缝,纹丝不动,决非易事。所以,一般需由有经验有艺术眼光的雕术师傅制作。制作过程大致是这样的:选材一一石底划线 一一挖木座底一一锯边-一座缘、座边一一座脚的雕刻 一一打磨一一上漆。漆以清漆为好,能显出木质天然纹理,且较素朴。 无论是具象石、抽象石、异石,还是图案石、色彩石,大部分适宜配木座,一些体量不大的小品,更需木座加以拱托。但需注意,术座的雕刻不宜过于繁复,线条崇尚简洁流畅,它起的作用 应是“烘云托月”,而不是“喧宾夺主”。比如人物象形石木座更应素朴,在人的视觉上有一种若有若无的感觉,这才能充分表达主体的神态。 黄杨木树根座。黄杨木树根天然奇特,可选择造型简洁且有平面者作为石座,其优点还在于价廉,选择得当有意外的效果。 衬板。有的抽象石、峰崖、图案石、色彩石更适宜直接置放于衬板上,其流畅的线条、纹理、色彩更能夺人眼目,其整体美也可完整无遗地得以显现。棘手的问题是如何以最佳位置把它放稳当。这个问题不解决,还得雕制小小的底座。衬板还适宜放 置对石或组合石,以呈现同一个主题。衬板一般以长方形为宜, 长与宽的比例以1.8:1为宜,厚度不得低于长度的八分之 一。 衬极外形也有制成扇形、椭圆、自由曲线形者,但切记应符合石之主题。 几桌。供石可配置座子后置于几案,也可直接置于几案,适宜者如“衬板”一段所云。几桌款式多样,有高几、矮几、平桌、香 炉桌等。制作材料当然以紫檀、红木为贵,其次样木、棒术、水曲柳等。但应注意,细长的供石宜用平桌或衬板,若置于高几上, 会显得孤鹤零丁,有危耸感。卧石等具有重量感的供石,可置于各种规格之几案,唯几足、案足也要厚实有力,这样整体就谐调了。 在衬板、案几上陈列的供石,可适当选择饰品点缀。点缀的目的在于充分表达供石之美。如塔、桥、舟、人、亭等,以瓷、陶或 铜质品为宜。饰品应精巧细微,它与供石的比例应在1:200以下,大者会喧宾夺主,小则无妨。饰品的位置应注意平衡效果, 深度、宽度、高度的空间效果。 石座。石座分天然与雕制两种。天然石座就是将扁平的江河卵石或海滩石置于供石底部即成,此法虽简,但配置得宜却难。雕制的石座,制作步骤及样式与术座略同-唯不需上漆。雕 制石座非经过特殊培训不宜为之。 水盘。一些自然景观石置于水盘,能更好地体现其意境与气势,有的因此能使人联想起海上仙山、江边峻崖。以水盘供石还有个好处是养石方便,喷水后还可欣赏石肤润水后的变化之 美:喷湿的石头在慢慢变干过程中,石头的颜色及肌肤因为深浅远近层次的变化,会呈现凹凸变化不同的氛围,有如山间雾气渐渐消散时的情景,令人心怡。 水盘的材料可以分为陶、瓷、铜三种,各有所长。水盘的款式分为长方形、椭圆形两种,盘缘以浅者为佳。长方形盘以安放 有力感的供石为好,正可衬托起阳刚之美。椭圆形盘较适宜安放有柔和感的供石,与其悠然自得的形态相得益彰。 盘底应铺砂,或以质地细腻的小白石代替。砂色可自可黄, 视主题而定。铺砂一方面可稳定供石的底部,另一方面也营造 了以白当黑的想象余地。所以要考虑供石与水盘大小比例及供石在盘中的位置。石大盘小会显得供石的膝肿,挤塞不开,石小盘大会显得虚渺空洞,没有着落。一般以1:2或1:2.2的比例为当,如要表现水天一色、海岛渺渺的景象,则可1:3的比例。至 于供石置于盘中是偏右、偏左还是居中,可自由调节,以恰当反映了主题为原则。 (二)居家摆饰 现代人工作紧张、生活单调,而古朴典雅、新鲜活泼的供石如陈列得当,恰好调节了家庭的氛围。 供石作为居家摆饰,或可陈设于几端,或可供之于案头,也可以专做一只博古架(博古架分为扇形、圆形、方形),置放中小体量的供石。但陈放时,应注意与整体环境的谐调,比如它与家 具的式样、色泽不能有违和感;供石之间、供石与家具、供石与其他摆饰之间要留有适当的空间,疏密相间,不可给人以压迫感; 石与石之间的呼应,要有前后、高低、左右、大小的变化,切忌排成一直线,造成呆板的印象,等等。除此之外,供石陈列的背景也很重要,如能在背景处悬挂一二幅境界幽远的山水画或飘逸的书法,效果会更佳。再如,在供石博古架上点缀数件其他种类的艺术品,如古人小瓷摆件、紫砂若壶、若碗,也会平添佳趣。 (三)奇石展览 供石除了居家摆饰,它还有社会功用,即参加奇石展览。这样,一方面让社会主更多的人从奇石中获得美感,陶冶情性,另一方面藏石家也可借此机会以石会友,切磋石艺,从中获得莫大教益。近年来,海内外的石展就接连不断,有综合性的,也有单一石种、单一主题的,大多数石展无论在社会效果上,还是在经 济效益上,都令主办者、参展者比较满意,参观者反响也比较热烈,由参观、鉴赏而加入到藏石家队伍中的也为数不少。 举办石展应注意整体布置的谐调。供石的陈列须留有充分的空间余地,虚实相间;灯光的照射不宜过于强烈;陈列供石的桌柜案几应高低搭配,有所变化;在人口处布置的供石应较有气 势;每一单元的供石应突出一个相同的主题;参展供石的题名此时尤其重要,标牌制作尽可能精美,供石题名的标牌比例要小一点,字迹也要求端正清秀。','2017-08-13 08:16:35',NULL,NULL),(9,'翡翠质地',NULL,'翡翠的透明度、水头、种、底子、质地实际上是一义多词。都是用来形容翡翠质地的好坏，行家多用种和底子表达，一般人用透明度表达。 常见翡翠质地的品种有： 1、玻璃地：玻璃地是指翡翠的结构非常细腻，呈透明、半透明，宛如玻璃，衡量玻璃地就是用肉眼看翡翠的透明度，一般用“水头”表示，一分水即是3mm的翡翠呈半透明状；二分水即是6mm厚的翡翠呈现半透明状。 2、冰地：是指翡翠的结构细腻，呈半透明状，宛如冰一样。 3、蛋青地：是一种较混浊的玻璃地品种。 4、油青地：是指老坑翡翠的主要底子色，质地细腻，色较暗，有油青色、蛋青色、蓝青色等。 5、干地：质地粗糙，不透明。有人这样形容，象鱼缸中的金鱼，水干鱼死，若翡翠没有水头，有翠也是死翠。 以上质地，以玻璃地为最佳，依次排列。','2017-08-13 08:18:31',NULL,NULL),(10,'玉件的保养与清洗',NULL,'1．避免与硬物碰撞。玉件受碰撞后很容易裂，有时虽然肉眼看不出裂，其实玉表层内有暗裂纹，这就大大损害其完美度和经济价值。2．玉器要避免阳光的暴晒。防止影响到玉的质地和色泽。3．忌化学剂，化学剂会给玉石带来一定的损伤，例如各样洗洁剂、肥皂、杀虫剂、化妆品、香水、美发剂等。如若不小心沾上，应及时抹除后清洗，不要让它对玉石造成损伤。4．尽可能避免灰尘、油污。若有污垢或油渍等附于玉面，应以淡肥皂水刷洗，再用清水冲净，切忌使用化学除油污剂。5．新购玉件一般也应在清水中浸泡几小时后，用软毛刷（牙刷）清洁，然后用干净的棉布擦干再佩戴。6．佩挂件最好用清洁、柔软的白布抹拭，不宜用染色布、纤维质硬的布料，这样有助保养和维持原质。7．定期清洗。玉件一般隔一段时间要进行一次清洗。8．玉佩等悬吊饰物，应经常检查系绳，防止丢失或损伤心爱的宝物。','2017-08-13 08:18:31',NULL,NULL),(11,'如何选择佩戴适龄的灵动翡翠',NULL,'有位珠宝界的专家曾说过：金子是钱，钻石是价，玉是生命。而玉中之王，就是翡翠。这个夏天，时尚不仅仅是充满现代感的金属和散发耀眼光芒的钻石，还有带着吉祥寓意的翡翠，带你游刃于传统与现代风尚之间。帮你为自己或深爱的人挑选一件翡翠，让关怀与幸福从此源源不断。 传统雕琢、造型简单规则的翡翠饰品适合送给老人。选择手镯、花件，尤其是象征福禄、长寿的葫芦、寿桃、福豆等造型。还可选观音、佛吊坠。翡翠要老种老绿、种水细腻，象征老人的深沉、豁达。挑选手镯应选圈口较大的，因为老人的骨质僵硬，圈口大的手镯佩戴方便，不易使老人受伤。 年轻人总走在时尚前端，可选择造型夸张、设计张扬的翡翠饰品。K金镶玉也是不错的选择。送女士可选镶嵌类挂件、手镯、如意等，紫罗兰色、白色、绿色，既庄重，又高贵。 送男士可选貔貅、竹节、马上封侯等，象征吉祥、步步高升。颜色应浓正或俏色，玉料材质应硕大、完整。 小孩儿活泼好动，皮肤细嫩，雕工简单、没有棱角的更适合。选择品种有平安扣、生肖、母子坠，象征平安、健康、茁壮成长之意。颜色要鲜艳，底子细腻，种水相对透彻。另外，还要考虑饰品的重量，小巧、重量较轻的比较适合小孩佩戴。','2017-08-13 08:18:31',NULL,NULL),(12,'书画用印的忌讳',NULL,'书画上落款盖印，印比字大不可以。大幅盖大印，小幅盖小印，理所当然。 国画直幅落款字下盖印，直下底角，不可再盖压角闲章。如右上落款，左下角可盖闲章，左上落款，右下角可盖闲章。如上款字印接近下角，闲章就不需盖了。 国画棋幅落款，左右两头角边，不可盖闲章。右上落款，左下角可盖方形闲章，左下落款，右下角可盖方形闲章。此处如不需要盖闲章，而勉强盖上，反而弄巧成拙。 长方形，圆形，长圆形闲章，尔不可盖在下角方形压角闲章处之地位。方形闲章，不可盖在书画上端空白处，就喧宾夺主了。 国画直幅落款，字行末行末字，与他行字长短，不可整齐，盖印亦如此。 盖二印，一方形，一圆形，不可匹配。同形印可匹配。 盖二印，一大一小，匚可匹配。同样大小可匹配。 盖二印，一长方形，一椭圆形，不可匹配。同形印可匹配。 盖二印，上阳文，下阴文，不可匹配，。而上阴下阳可匹配。 盖二印，上阳文，下阳文，不可匹配。而上阴下阳可匹配。 盖二印，上阴文，下阴文，不可匹配。而上阴下阳可匹配。 落款盖印之下，不可再题字，。印章上下有字掣肘，就失去自然现象。 已经落款盖印字画，款後不可再落上款赠人，就失敬了。 花头，鸟尾，树枝，山顶上，不可落款盖印。这是画家最起码的常识，不可不懂。 匠刻印章，不可用於书画上，需用艺术篆刻家，所刻石章最佳。 普通印，不适用於书画上，要用八宝印泥。 盖二印，距离不可太远太近，相隔一个印距离正好。 盖二印，印文，章法，刀法各异，不可匹配。要用相同刀法所刻印章。 画上不可题打油诗，一来识者奚，落二来作品就贬为低俗。 上款上端不可盖闲章，压在人名头上，人家很忌讳。一来失礼，二来破坏了画面。 盖压角闲章，不可太小，宣纸四开，用方形石印，大约叁公分，比较适中。 盖压角闲章，不可盖二方上，一方正好。印与边距离约一。五公分为适中。 落款字下不盖印，而偏要盖在款字左右，脱离字行，而成画外物，特殊情形例外。 书画上，不可盖上劈头大印，即成巨印炸弹，毁灭了美丽的画面，令人看了很恐怖。 小画不可题大字，大画不可题小字。小空不可题字多，大空不可题字少。 书画上姓名印，不可连盖叁印以上，应盖二印，或一印妥当。 书画上下左右，不可任意盖印。盖多不当，不如少盖，印章印泥不佳，倒不如不盖好。 盖二印，不可东倒西歪，如何盖法，用力轻重，印章印泥保养，一切要潜心研究，是不可忽视的问题。 画上不可题上粗俗字题，致影响画面美感，就未能免俗了。 书法四联首幅，右上可盖印首小长形章，其馀不可盖，如统统盖上，行气就破坏了。','2017-08-13 08:19:50',NULL,NULL),(13,'翡翠的鉴别方法',NULL,'多掌握正确的翡翠的鉴别方法，对翡翠爱好者来说非常有用处。下面为大家介绍翡翠的鉴别方法，希望对大家有帮助。 1、光泽。翡翠经强酸碱浸泡处理后，结构疏松，没充填之前表面见溶蚀凹坑，使之产生漫反射，光泽变弱。加人树脂或塑料等有机充填物后，翡翠常有树脂光泽、蜡状光泽或者是玻璃光泽与树脂光泽、蜡状光泽混合。 2、颜色。由于翡翠结构被破坏，内在原有的光学性质也发生了改变，所以“B货扩翡翠的颜色分布无层次感。虽然这种方法处理的翡翠的绿色仍为原生色，但经过酸性溶液的浸泡，基底变白，绿色分布较浮，原来颜色的定向性也被破坏了，看起来很不自然。 3、结构。翡翠受到强酸强碱浸泡腐蚀后，有部分物质带进带出，在表面及内部沿矿物晶体间形成溶蚀，产生内部的连通式裂隙。在透射光照射下，可见内部纵横交织的裂隙。在反射光条件下，表面的溶蚀凹坑或蛛网状网纹清晰可见。 4、表面特征。这种方法处理的翡翠由于充填物与翡翠本身的硬度差别较大，在原生的裂隙处呈较明显的凹沟，充填物明显低于两边，许多绺裂组成了纵横交错的誓沟渠”。较大的“沟渠”中可见胶结物或残留气泡。近期加工技术较好的漂白加充填处理的翡翠表面非常光滑，无上述现象，须更加仔细地观察和测定。 5、密度、折射率。漂白充填处理的翡翠多数密度、折射率略低。密度为3．00～3．43g／cm，折射率为1．65左右(点测)。但是由于翡翠的矿物组成复杂，某些天然翡翠的密度和折射率值也可能偏低，所以密度和折射率只能作为参考数据，通常不能作为判定翡翠是否经过充填的依据。 6、荧光性。无或弱至强的紫外荧光，荧光分布均匀或呈斑杂状。早期“B货”翡翠绝大多数有荧光。短波：弱，黄绿或蓝绿(蓝白)；长波：中至强，黄绿或蓝白色。但近期这种方法处理的翡翠通常荧光强度较弱或无荧光。 7、放大检查放大检查是鉴定这种处理翡翠的有效方法。分为表面观察和内部观察。 用反射光观察样品的表面，通常可见到三种情况：①表面明显可见分布较均匀的“蛛网”状或“沟渠”状裂纹。这是确定无疑的漂白充填翡翠。但要注意与抛光不良造成麻点状表面相区分。漂白充填处理翡翠裂隙边缘较为圆滑，“翠性”不明显；而抛光不良所形成的麻点状凹坑多呈三角形，边缘较尖锐，分布不均匀，多出现于颗粒粗大处，“翠性”明显。②表面抛 光较好，但局部可见细小裂纹相对集中。这是因为翡翠经漂白充填处理后又经过较为细致认真的再抛光，使得表面较光滑，局部细小裂纹是被破坏的翡翠颗粒间的极细小缝隙未被完全充填的表现。③表面极为光滑，细小的裂纹很少，但在表面出现很多类似“翠性”反光的亮点。亮点往往是在较粗大颗粒的表面或内部重叠分布，而不似解理面的片状闪光。在高倍显微镜下，可见许多小亮点为小的气泡，这是由于在充填处理时未能把缝隙里面的空气全部抽空而保留下来的气泡。 用透射光观察翡翠的内部结构。经过漂白充填处理的翡翠结构松散，颗粒边缘界限模糊，颗粒破碎，解理不连贯。 8、热反应。“B货”翡翠加热200～300℃后胶质发生碳化。 9、敲击反应。经过漂白充填后的翡翠，其结构被破坏，矿物颗粒间被胶质充填。因此轻轻敲击后发出沉闷的声音，与天然翡翠清脆之声有明显的区别(此法主要适于翡翠手镯的鉴别)。 综合上述，B货翡翠与A货翡翠肉眼的快速区别要点在于：B货翡翠洁净，见不到红褐色铁质痕迹；成品表面均匀展布龟裂纹且带有“黄气”；注入翡翠内部的“胶”，使翡翠的光泽变暗，用手电光透视或放进水中透明、清晰度降低，均一。使成品的整体展示出一种乳白色的蜡状外貌。在紫外荧光下发出强弱不等的蓝白色或绿白色荧光。肉眼鉴别翡翠A、B货过程中，往往会出现A、B货两种特征现象共同出现的状况。这时应先抱以怀疑的态度，耐心、谨慎地再进行反复细致的观察。 最稳妥的还是交由专业人员，通过各种仪器设备进行全面检测，以科学的数据分析作出准确判断。切忌抓住一两个特征便莽下结论，这样很容易使自己产生错误判断。','2017-08-13 08:19:50',NULL,NULL),(14,'翡翠的形成',NULL,'翡翠是如何形成的？民间有很多神奇的传说；地质学家以前一直把它看成一个谜，曾有人认为翡翠与钻石一样，都是在地壳深部几千度高温，高压条件下结晶形成的，其实不然；美国不少地球物理学家在实验室做了大量的仿真实验，再结合世界各地发现翡翠矿床的实际情况，他们认为，翡翠并不是在高温情况下形成的，而是在低温条件下在极高压力下变质形成的。 日本东北大学砂川一郎教授在《话说宝石》（1983年出版）一书中，更具体指出翡翠是在一万个大气压和比较低的温度（200 - 300℃）下形成的。我们知道地球由地表到深部，越往深处温度越高，压力也越大。但翡翠既是在低温高压条件下结晶形成，当然不可能处于较深部份，那么高压究竟从何而来呢？ 这高压是由于地壳运动引起的挤压力所形成的，现已获得证实，凡是有翡翠矿床分布的区域，均是地壳运动较强烈的地带。 还有另外一个因素是：凡发现有翡翠形成的地方均有含钠长石的火成岩侵入体（中─基性岩）。钠长石的化学成份为 NaAlSi3O8，所以可以推测翡翠是在低温、高压条件下由含钠长石的岩石去硅作用而形成的。 若要成为特级硬玉——翡翠，还须具备以下条件，翡翠围岩必须是高镁高钙低铁岩石。这种环境产出的翡翠更纯净，少铁使底不发灰。尽管低铁但还是有铁的存在，要翡翠十分纯净无杂质，还须在强还原条件下，即在还原环境中生成。因为在缺氧环境中，它所含的Fe会形成磁铁矿而析出，而不进入翡翠的晶格内，可使翡翠绿更正。再者要有生成翡翠后的地质作用及多次强烈的热液活动，把翡翠改造得绿正、水好、底纯的特级翡翠。翡翠成色过程是伴随着热液活动进行的，为多期强度不同的成色过程。而且缓慢分解成铬离子的致色元素，要长时间处在150-300℃，最佳温度是在212℃左右下，铬离子才能均匀不间断地进入晶格，在这种条件下生成的翡翠绿色非常均匀。完全生成特级翡翠后，还不能有大的地质构造运动，否则将会产生大小不等，方向不同的裂纹而影响质量。以上各条件很难同时具备，这就是为什么特级翡翠稀少的原因。','2017-08-13 08:20:56',NULL,NULL),(15,'浅谈中国书画装裱的重要性',NULL,'中国书画主要是采用绢或宣纸做成。其材料质地纤薄、特性柔软、历时较久、易于破碎，古代为了利于保存，便于观赏，从加固的实用需要出发，多用麻纸、布帛等材料在书画背面裱褙数层为装裱，称之为“裱褙”。而后逐渐加以美化，四周镶嵌薄型的绫、绢等丝织品为边框，在背面裱一层或数层纸，并加上必要的装饰，使原件更为牢固，而且便于舒展、悬挂，以适应人们观赏的要求。所以说装裱是伴随着书画传统艺术的发展而产生的书画装裱工艺。装裱可以说是对书画的深加工。明代周嘉胄在《装潢志》中说:“装璜优劣，实名迹存亡系焉。窃谓装璜者，书之司命也。”（装裱得好坏，直接关系着名人手迹的存亡。笔者认为装裱这件事，是决定书画命运的大事。）正如近现代著名画家傅抱石先生在1957年1月3日《人民日报》上发表的《裱画难》一文中说：“作为一件艺术品，除了画面的艺术水平决定画家而外，装裱是最重要的一关”，足见书画装裱在整个书画艺术中的重要性。◆新作书画应及时装裱凡新写好的字画，一般要存放一段时期，让墨色、印泥有一个自然晾干的过程，但最好不要长期放置，因为写画时受水墨、颜色和胶水的浸渍，干后就会凸凹不平、起皱痕，若不装裱衬托，非但不如原来的样子，还要减色。所以一定要及时装裱，才能使墨气托出纸面，使画面生动，有益于颜色滋润、饱满浑厚可观。而且经过艺术设计的装裱，显得整洁美观，更能增添神韵。要是放置不裱，如画心空卷的不实或折叠成块等。也不宜保护，存放时间日久就会从折叠处折断纸绢的纤维，印泥可能会转印到画面上。或不慎造成断裂破损、残缺、污染、变色、水渍等明显损伤，如最易发生黄色斑点，很难去掉，并容易招致蠹蚀。为日后收藏留下隐患，装裱后直接影响书画作品的品相，也影响观赏价值和艺术价值。如经常受潮湿，易生白、红、黑霉斑，若湿后粘连，就不易揭开，即使晾干也变成了废纸、烂纸灰，无法挽救。清代周二学在《赏廷素心录》中说：“书画不装潢，既干损绢素；装潢不精，又剥蚀古香。”（“书画不装裱，就会很快使绢面或纸心受到损坏；装裱得不精美，又会侵蚀书画原有的古色、古香的韵味。”）由此说明，要想书画保持永久，便于欣赏、收藏、流传，必须及时装裱。而装裱技术的高低、绫绢色彩的选择与装裱形式的设计直接影响到书画作品的艺术效果。如有很高价值的新书画作品，装裱地好就会锦上添花。◆古旧书画重裱时要慎重，宜选良工历代传世及出土书画作品，或者由于装裱不佳，发生空壳脱落，或者由于在流传过程中被撕断，或者收藏保管不善，或者由于长期埋于地下朽烂叠粘，或者自然灾害等原因；如遇屋漏必沾雨水痕迹，如尘土、烟气常熏，则纸、绢画心变黑黄，其墨色暗淡无光，或受潮发霉被虫蛀鼠咬等，以致笔墨污损残缺，糟朽断裂破碎脱开等，无法再悬挂欣赏、研究。一般年代愈远的作品，受伤程度愈重，这就需要重新装裱。重新装裱必须经过精心揭裱修复，做到修旧如旧，犹如枯木逢春，才能恢复古书画作品的“原貌”，其功效等同于再次创造古旧书画的艺术生命，并再现原作的艺术风采，有益于欣赏收藏，延长古旧书画寿命。但古旧书画重新揭裱时要慎重，应当请教有经验的良工高手。明代周嘉胄在《装潢志》中说：“前代书画，传历至今，未有不残脱者。苟欲改装，如病笃延医，医善，则随手而起；医不善，则随剂而毙。所谓‘不药当中医’，不遇良工，宁存故物。”（前代的书画，经过许多朝代的流传保存至今，没有不残脱的。如果想重新装裱，改换装潢，就像患了重病去请医生医治一样，医生的医术高明，就能随手药到病除，迅速恢复健康；医生无能，病人服了药会误事死亡。所以说：“不用药，保持病人的原状，是中等的治疗，乱用药不如不用药”。同样道理，古代的书画珍品，没有遇见优良的装裱工，宁愿保存残脱的旧画，以免在重裱时，被劣工揭损裁毁等。）古旧书画重裱如延医治病，这就说明了古旧书画重新装裱的重要性。需要重新装裱的古旧书画，应采用传统的裱画技术，给以修补装裱，使它能长期保存，这就是对古旧书画文物保护的一项重要贡献。如果遇上庸工滥施手术，就能置名迹于死地，故装裱的技艺高低，实系古旧书画艺术存亡的关键。装裱人员只有把技艺提到一定高度，才能把古旧字画装裱得更好，不至将少有的古迹毁于手下。例如在揭裱修复过程中，往往为了使古旧字画干净漂亮一些，便采用漂白粉漂洗。稍有不慎，就会把画纸腐蚀得更加糟朽。这对延存古迹大有害处，很珍贵的古书画，重裱得好，价值可以倍增，重裱得不好就成了废物，切切慎之。','2017-08-13 08:20:56',NULL,NULL),(16,'和田玉的鉴定',NULL,'和田玉的价值虽不及硬玉高，但它也有个鉴别真伪的问题，通常用来冒充软玉的有以岫玉为代表的普通玉石，新近出来的俄罗斯玉和青海玉，以玻璃料。下面分而述之。 1、软玉与岫玉的辨别 前面已经谈到，和田玉其质地、硬度和比重都有一定的指标；而岫玉则是产于辽宁岫岩县，其质地、硬度和比重都不及。加上岫玉开采量大，物因多而贱，故市场价格非常便宜。 岫玉由于质地细腻，水头较足，呈卉状至油脂光泽，所以常常把它做旧来冒充老的和田玉。但岫玉性较，易吃刀，鉴别的最好办法是用普通小刀刻几下，吃刀者为岫玉，纹丝不入者为和田玉。如果身边没有带刀，只段细看雕刻时的受刀处，和田玉受刀处不会起毛，而岫玉则有起毛。此外，手感岫玉也较轻，敲击时声音沉闷黯哑，不像和田玉清脆。 除了岫玉，还有其他普通玉石用来冒充和田玉，其鉴别方法大致同上。 2、和田玉与俄罗斯玉、青海玉的辨别 我国青海和前苏联中亚地区，现在也出产一种玉，俗称青海玉和俄罗斯玉，估计皆为天山山脉的支脉所产，故而矿石成分相似。这种玉多为白色，看上去也似蜡状油脂光泽，因此很容易冒充白玉。而且它的硬度和白玉一样，故而不能用与否来鉴别其真伪。但这种玉所含石英质成分偏高，因此与白玉相比，质粗涩，性粳，脆性高，透明性强；经常日晒雨露，容易起膈、开裂和变色。特别是将和田玉与俄罗斯玉放在一起加以比较，一个糯，一个粳；一个白得滋润，一个则是“死白”，其高下之别不言自明。同时，敲击时一个声音清脆，一个沉闷，也不难分辨。 3、和田玉与“料”的辨别 坊间通常还以玻璃来冒充和田玉，俗称“料”。这方面的鉴别相对不是太难，一般说来，玻璃颜色一气呵成，没有自然变化，里面有料泡（有的可以通过雕工把料泡做掉）；其质料比较纯，比较纯洁，不像和田玉有玉茎，有绵状、萝卜丝状等自然结晶状；用放大镜观察，玻璃的毛孔比和田玉粗得多，断口呈亮碴贝壳状，和田玉则呈暗碴参差状；玻璃的硬度低，容易吃刀，和田玉则硬度高，不吃刀；此外，把玻璃料贴在脸上感觉敏感的部位，其凉的程度低于玉。此外，敲击时一个声音沉闷，一个清脆。 另外：和田白玉越来越俏 2004年中国玉器市场，和田玉市场地位得到进一步确立，价值得到进一步提升。 和田玉是中国玉器的当家玉，是帝王玉，是中国儒家道德、礼仪文化的重要载体，是中国的国石。有人对中国国石抱有不同的意见，争吵不休，其实不用争论，无论是从历史文化背景考察，还是从目前市场行情，和田玉是名副其实的国石。2004中国玉器市场再次提升和田玉的国石地位。 2004年和田玉深受市场欢迎，和田白玉价格更是无与伦比，无论是拍卖，还是专卖，和田白玉求之若鹜，不嫌价格贵，只嫌货源少。2004年香港佳士得春拍\" 德馨书屋\" 玉器专场中，拍得最好的几乎都是白玉。一件和田白玉罗汉摆件，成交价140.775万港元，为预估标的6倍。一对乾隆和田白玉山景人物图插屏，分鸶〉?quot; 太平有象\" 与\" 太狮少狮\" 吉祥图案，为文房珍玩，尺寸24.8×18.5厘米，以252.775万港元拍出。 2004香港苏富比秋拍一件清乾隆白玉茶壶，高19厘米，估价500～700万港元，与清乾隆御制\" 痕都斯坦玉御题诗\" 贝式白玉洗估价相同。壶身浑圆而于肩部略宽，足部外敞。美在材质，玉质通透，白得耀眼，乳白中略带青色，以致无法将玉材的 近年来收藏市场“曙光初现”，书画、瓷器、玉器等传统的收藏品行情看涨，其中玉器更是“奇货可居”。据业内人士透露，现在好玉可以卖出天价，而且在经济日益发达、社会稳定的情况下，玉的价格还会继续上涨。另外，和田玉被制成了奥运徽印---中国印，再一次确立了和田玉玉中极品的地位，掀起了玉器收藏的一次高潮。如今珠宝玉器市场日渐繁荣。据有关部门统计，2003年，我国珠宝玉器首饰贸易额达到1000多亿元。目前在各种美玉中，和田玉的价格正在急速增长，去年10多万一公斤的和田玉，今年30多万一公斤都难以买到，上好的羊脂白玉子料更是难觅其踪；缅甸的翡翠玉的价格也同比上涨了三分之一。但是，品质一般或较差的玉，价格变化不多甚至有下降的趋势。 “玉石满街，佳品难觅。好玉真是越来越少了啊！”这是近年来玉器投资者的共同感慨。据了解，如今越来越多的人开始直接到新疆购买玉器，作为玉中上品的新疆和田玉，近几年由于需求大增，虽大量开采，仍然难以保证供应。内地古玩界的人士告诉记者，以前卖货给他的几个新疆人，今年都不来了。一来是没有好的玉器出手，二来产品在新疆当地就很好销售。','2017-08-13 08:22:23',NULL,NULL),(17,'投资当代书画艺术作品　切记三个为什么',NULL,'书画家的职业是创作艺术品，体现其心血、对美好事物的讴歌、记录的载体是其作品，许多因凝练着艺术审美情趣的作品在社会上经久流传，因此成为人们争购的藏品自不为过。但是，随着艺术品市场的火热，越来越多的画家已经不再将创作的第一要务锁定为“艺术价值”，而是大肆追求经济价值，某某一平尺八千元，某某的几万元，如果按此价值评定标准来看，许多画家的创作过程已经成为了“画钱”行为，这也是大量画家不肯再赠送书画的原因。艺术家和歌星、影星一样，也是社会名人，也会有自己的“粉丝”，但是在当今的艺术市场中，购买当代画家的作品时应该先问三个“为什么”，这是一位业内人士的忠告。■第一：为什么追捧该艺术家？在购买作品时，一定要注意观察该画家是否属于实力派，如果该画家的功底确实比较扎实，而且多在大赛中获奖，其风格得到大多数人的认可，且其在圈子内有一定知名度，而且其作品的价格也确实是逐渐稳步上升的，这样的画家属于值得关注投资型。问此问题的原因包括：一些艺术家的知名度并不是很高，其凭借着在社会上的活动能力使其知名度逐渐上升，但其水平却很一般，这样的作品即使在短期内可以获利，但却不宜长期投资，因为当更多人了解其底细时会逐渐将其放弃。还有一种人，凭借其地位等影响力，在自己圈子内获得一定数量人们的追捧，但这类画作并不能代表其水平，当其社会地位不再继续时，水平确实一般的画作会逐渐被遗忘，更别说升值了。同时还要看作者的作品是否很多，如果高产的话就不能完全排除“画钱”的嫌疑，另外如果一位画家有大量作品，其升值的空间也将不会太大，毕竟俗话“慢工出细活”还是有一定道理的。■第二：为什么买其作品？在准备买作品时，一定要问自己这个问题，自己是出于爱好还是投资，如是爱好则另当别论，而如果是投资的话，一定要关注该作者的发展轨迹，如此前默默无闻、在短期迅速成名的则更要留神。要仔细分析其风格是否独特，也就是是否有自己的特点，还是被包装迅速成名的。业内人士建议，投资书画艺术品，在目前市场处于价格高位时，最佳的途径是留心那些学院派代表人士，如美术院校刚毕业获未毕业的学生、任教的老师等，因为他们毕竟学习过系统知识，而且作品尚不多，这类画家如果在大赛中获奖而且屡屡获奖，足以证明其水平。这类作品如果遇到合适机会，自然会迅速升值。但是，在选择这类画家时，也要参照上面的问题进行分析，总之要抱着长线投资的心态，也就是从其成名及创作时间等因素，看其是否值得关注。此外，如果是投资的话，自然还要考虑到将作品再次送上拍卖会的实际问题，一般情况下，拍卖公司会对那些曾经获过大奖项的作品感兴趣，同时还会关注其是否在著名的出版物上出版过。只有将画家艺术水平、出版经历可靠、真实奖项三大问题进行研究之后才能“踏实投资”。■第三：作品因何而升值？近年来，许多当代艺术家的身价陡增，有的作品此前曾不为人所知、看好，而在近年来却屡屡创下个人的成交价格纪录。这是个不能不分析的问题。一般来说，看涨的作品绝对不是应酬之作，而是其潜心创作的精品，而且作者还有一定的知名度。但是关注其知名度，一定要看其是否属实，有些画家并未获得过多少大奖，而是通过自己筹资办个展、巡展等方式进行宣传，这也是目前许多人所习惯采用的一条路。也有的确实获得过某些奖而一举成名，再凭借展览等方式让社会各界了解自己。对于升值问题，业内人士向记者提到了一个不良现象，有些画家为了让自己的作品升值，会雇托儿进行炒作。如自己的一幅油画当时仅值8万至10万元，当有人从他手中购买作品时，双方会达成协议，该作品以10万元的价格售给买家，由画家以不高的价格将作品送到拍卖公司，而由买家交纳保证金后，由买家在拍卖现场疯狂“举牌”造势，本来仅值10万元的东西，最终居然可以叫到100万元以上。但事后，买家并不会提货，宁可损失保证金，待拍卖公司将作品退还画家时，再以原来的价格拿货，也就是说这幅表面已达100万元的作品仍以10万元的价格售出。上述现象也是有些画家采取的一种方式，这也是作品飞速升值的因素，当其作品第一年能卖100万元时，第二年再向拍卖公司送拍时身价至少也能由10万元涨至30万元。因此，当藏家在选择某位画家时，一定要掌握其作品的升值过程及升值空间，不可跟风炒作，以免中了卖者的圈套。','2017-08-13 08:22:23',NULL,NULL),(18,'中国将成全球拍卖市场',NULL,'中国角色 国际拍卖公司对中国内地市场一直垂涎三尺，但由于中国政策不允许外资拍卖公司在内地单独设立拍卖机构的限制，外国拍卖机构不能进入。表面上看，中国艺术品市场是个相对独立的市场。但事实上，经济的高速发展已使中国的收藏市场成为全球拍卖市场。 市场有待成熟 虽然中国的艺术品投资市场发展迅猛，但距离成熟还十分遥远。 经济基础尚不牢固是根本原因，有资料表明，一个国家的人均国民生产总值达到8000美元时，才有可能形成社会性艺术品收藏兴趣；人均年收入达到10000美元时，才有可能健全艺术品收藏的社会机制。 尚处于初级艺术品市场阶段的中国，艺术购藏群体结构与西方差异极大。目前艺术品市场的投资者，只是少数富人阶层，这些数量有限的投资者，其艺术鉴赏能力方面的准备也并不充足。 社会各方面对拍卖企业运作的要求也越来越高，越来越严，藏家现在更为关心公平公正的交易平台，更为诚信的市场环境。随着拍卖企业设立审批制的逐步规范和透明，投资拍卖行业更加容易，外加上国际同行的介入，使得这一领域的市场竞争日趋激烈。 市场迅速发展，拍卖公司也出现优胜劣汰的整合和调整。市场资源逐渐向实力雄厚的大公司集中，一些实力较小、信誉较差的拍卖公司开始被淘汰出局。 此外，中国的《拍卖法》正式实施10年，对规范拍卖行业内部行为，促进拍卖事业发展起到了巨大作用。但是，有关专家认为，由于形势发展太快，现行的《拍卖法》对拍卖业中出现的一些新问题难以解决。由于《拍卖法》缺少硬性的规定及其自身规定存在矛盾，导致了其适用范围狭小，限制了拍卖行业的发展。 在艺术市场的运行规律、游戏规则、激励机制和职业道德等方面，中国内地拍卖市场在很大程度上都还落后于西方。 西方艺术市场经过长期的发展，目前已形成了一整套完备的机制，由画廊、拍卖行、艺博会组成的“铁三角”，为艺术市场提供了稳定坚实的基础。由艺术家、经纪人、评论家和收藏家“四位一体”组成的市场链，使西方艺术市场长期处于良性循环和螺旋式上升的状态。以此为参照，反观中国艺术市场，其落后是显而易见的。 “我希望国内藏家多参加国际拍卖市场的拍卖活动，这样不仅可以带动国际拍卖市场的发展，也可以拉近国内藏家与国际藏家的差距。”翁晓惠说，嘉士得等国际艺术品拍卖行的进入，给中国艺术品市场带来的，不单单是与国外艺术品的零距离接触，更重要的是推动中国内地艺术品市场的发展，使其更趋于成熟。 据翁晓惠透露，佳士得已准备从伦敦、纽约引进相关的艺术品鉴赏课程，在中国开设艺术品鉴赏硕士班，并开展有关主题演讲，提高国内藏家的艺术品鉴赏能力。 补白： 在长达数千年的中国收藏史上，曾出现过三次全国性的“收藏热”，它们分别发生在北宋末年、康熙年间和清末民初。 这三次“收藏热”的共同特点是上至帝王将相，下至平民百姓都以收藏为乐；伪造的艺术品、工艺品花样翻新，并能以假乱真；市场上古玩、书画交易频繁；研究成果不断问世，鉴赏水平较高。 有人说，如果以此来衡量，中国正处于第四次收藏高潮。','2017-08-13 08:22:53',NULL,NULL),(19,'带玉的好处和功效',NULL,'古人讲佩玉为美，黄金有价玉无价。玉埋藏地下几千年货是上亿年，玉中含有大量矿物元素，所以人们常说人养玉玉养人，如果人的身体好长期佩玉可以滋润玉，玉的水头也就是折光度会越来越好，越来越亮。如果人的身体不好长期佩玉，玉中的矿物元素会慢慢让人体吸收达到保健作用，譬如女士戴玉的手镯通常带左手，因为对心脏有好处。玉为枕而脑聪，古代皇帝就喜欢用玉做枕头，向中国古代长寿的皇帝都久用玉枕。而且像《本草纲目》也有对玉保健作用的介绍。 戴玉的好处 我国自古以来就有“玉石之国”的美名，古人视玉如宝，作为珍饰佩用。古医书称“玉乃石之美者，味甘性平无毒”，并称玉是人体蓄养元气最充沛的物质。认为吮含玉石，借助唾液与其协同作用，“生津止渴，除胃中之热， 平烦懑之所，滋心肺，润声喉，养毛发。”因而玉石不仅作为首饰、摆饰、装饰之用，还用于养生健体。自古各朝各代帝王嫔妃养生不离玉，而宋徽宗嗜玉成癖，杨贵妃含玉镇暑。 玉的养生机理已经被现代科学所证实。据化学分析，玉石含有多种对人体有益的微量元素，如锌、镁、铁、铜、硒、铬、锰、钴等，佩带玉石可使微量元素被人体皮肤吸收，活化细胞组织，提高人体的免疫功能。故有中医所说“有的病吃药不能医好，经常佩带玉器却治好病”，道理就在于此。倘佩带玉手镯长期的良性按摩，不仅能被动除视力模糊之疾，而且可以蓄元气，养精神。 专家认为： [白玉] 有镇静，安神之功。 [青玉] 避邪恶，使人精力旺盛。 [岫岩玉] 对男性阳痿患者很有效，能提高人的生育能力。 [翡翠] 能缓解呼吸道系统的病痛，能帮助人克服抑郁。 [独玉] 润心肺，清胃火，明目养颜。 [玛瑙] 清热明目。 [老玉] 解毒，清黄水，解鼠疮，滋阴乌须，治痰迷惊，疳疮。 玉石不但能美化人们的生活，陶冶性情，而且祛病保平安。其产品直接用于健身保健的有：玉枕、玉垫、健身球、按摩器、手杖、玉梳，对人体具有养颜、镇静、安神之疗效，长期使用，会使你精神焕发，延年益寿。 玉器真假辨别法 玉器价格昂贵，挑选技术要求很高，绝大多数消费者都难以辨别其优劣、真假，稍有不慎就容易购买到劣质品或假货，蒙受重大的经济损失。市场上销售的玉器店家很多，玉器一般分为软玉和硬玉两大类。硬玉又叫翡翠。从化学业成分来说，软玉是含钙、镁和铁的硅酸盐；硬玉是含钠和铝的硅酸盐。 下面介绍玉器的优劣、真假辨别方法： 水鉴别法→ 将一滴水滴在玉上，如成露珠状久不散开者真玉；水滴很快消失的是伪劣货。 手触摸法→ 若是真玉用手摸一摸，有冰凉润滑之感。 视察法→ 将玉器朝向光明处，如阳光、灯光处，如果颜色剔透、绿色均匀分布就是真玉。 舌舐法→ 舌尖舐真玉有涩的感觉；而假玉则无涩的感觉。 放大镜观看法→ 将选购的玉器放在放大镜下观看，主要是有无裂痕，无裂痕者为上乘优质玉，有裂痕者为次之。即使是真玉，有裂痕的其价值亦大减，裂痕越多越明显的，价值也就越低.','2017-08-13 08:23:48',NULL,NULL),(20,'玉：石头到玉器再到文化（一）',NULL,'红山文化——玉神人 古往今来，“玉”字在人们心目中都是一个美好而高尚的字眼。人们用玉字组成不计其数的词，来表达自己所喜爱的事物，例如玉貌、玉体、玉女、玉容等等，并把为正义而死形容为“宁为玉碎，不为瓦全”。现今日常生活中，玉器或佩戴，或陈设，不过是寻常装饰品而已。玉器在中国文明史上的重要性，并不是人人皆知的。 玉文化绵延7000年，至今魅力不减，生命力越来越旺盛，不能不说是世界文明史上的奇迹。玉器对中国古代的政治、礼仪、商贸、图腾、宗教、信仰乃至生活习俗和审美情趣所产生的深刻影响，是其他任何古器物无法比拟的。它是远古先民顶礼膜拜的神物，是森严礼仪等级制度的象征，是古人审美观念的表现，更是中华民族美好品德的化身。一部玉器发展史就是一部中国文明史，中华民族以“爱玉”和“尊玉”而著称于世。 玉器在古代社会中既是精神财富，也是物质财富。玉所特有的美丽光泽和温润内质使它成为一种超自然物品，被赋予人文之美，古人似乎对玉倾注了全部的才智和热情。所谓“君子比德于玉”，“德”既是玉的特性，又被拟人化、道德化，成为古人心目中正人君子良好品德的象征。玉材的珍稀和雕工的艰难，以及用玉礼制化，使得玉器的身价为货宝之首，古人有“黄金有价玉无价”之说。 先民制玉 玉是以其绚丽的外观和温润的内质受到人们重视和推崇的。作为一种工艺品，它的产生是与古人的审美观念相联系的。那么，玉饰品最早是什么时候出现的呢？ 在人类迎来文明曙光之前，我们的祖先曾经走过了几百万年漫长的发展历程。到了距今4万年至1万年之间的旧石器时代晚期，随着制石工艺的进步，生活状况有了明显的改善。在我国北方的黄河、辽河流域的一些原始人类中，逐渐萌发出审美意识，这种意识反映在现实生活中，就是产生了许多以兽牙、骨制成的人体装饰品。虽然在旧石器时代还没有出现玉饰品，但其他各种质料人体装饰品的出现，表明了审美观念的萌生和人们精神世界的日益丰富，而这一切为玉饰品的诞生奠定了基础。 新石器时代，人们普遍使用磨制工具，生产技能有了重大飞跃，随之而产生了治玉技术。从目前考古发掘资料来看，最早的玉器出现于内蒙古赤峰市敖汉旗兴隆洼文化遗址和辽宁阜新市查海文化遗址中，这两处遗址的时代距今均为7000年至8000年，共出土玉器数十件。这些玉器色泽纯正，磨制光滑。从玉器形制之奇巧、工艺之精美、选料之准确来分析，当时的玉器制作和使用已比较发达。玉器的出现与人类从打制石器转向磨制石器的生产技能的提高有密切关系，因为制作一件玉器最基本的步骤是切坯、琢磨和钻孔，需要有比较高的磨制技术，这样才能制作出具有一定美观造型的玉制品。 除中国外，世界上还有两个地方以玉器工艺闻名，即中美洲和新西兰。这两处所产玉器无论在造型、纹饰上，还是在延续时间和使用数量上，都远逊于中国古代玉器，所以中国制玉工艺在世界琢玉史上占有极为重要的地位。 玉石之辨 原始人类对玉器的认识有一个发展的过程，当时人们常把质地比一般石材更细腻坚硬、色彩绚丽斑澜近似玉质的彩石视为宝物，因此古人对玉的笼统概念是“石之美者”，并赋予这些充满神秘感的“美石”以信仰和崇拜功能。 由于生产技术水平较低，加工这些玉石料不易，所以琢制成型的彩石更显珍贵，这是人类对玉的最初认识。当时的玉器质料较杂，并非像后世玉器以纯玉料制成，而是杂以各种石料，所以此时的玉器可称为“彩石玉器”。而现今人们常把质地坚硬细腻，色泽温润典雅，硬度较大，具有透明感，适于雕琢成工艺美术品的岩石和矿物称为玉。 玉的质料有广狭二义。广义上的玉料包括软玉、硬玉、碧玉、蛇纹石、水晶、玉髓、玛瑙、斜长石、黝帘石、汉白玉、石英岩、芙蓉石、松石、青金石等。狭义的玉料指的是软玉、硬玉、蛇纹石和黝帘石，这个定义比较严格，具有科学性，因此被广泛采用。 从矿物学角度来看，软玉是角闪石族钙角石组透闪石－阳起石－铁阳起石系列之具有呈毡状、簇状、捆状交织纤维显微结构者，具有油脂、蜡状光泽，摩氏硬度6－6.5度，比重为2.96－3.17。软玉的质量取决于它的显微结构特征，也就是透闪石－阳起石交织纤维的粗细程度，纤维越细，质量越好。优质的白色软玉由透闪石组成，分布不广而少见，正如古人所言：“玉以少贵，石以多贱。”软玉的颜色取决于矿物中所含的微量元素。不含铁的透闪石呈白色或浅灰色；含铁的透闪石呈淡绿色或褐色。 软玉是我国最重要的玉石品种，主要产于新疆和田地区。和田玉应用历史悠久，质量最佳，西方学者曾将和田玉称为中国玉，作为中国特有玉料的代表。和田玉主要分布在新疆塔里木盆地南面阿尔金山脉和昆仑山脉，东起且末县，西至塔什库尔干县，东西绵延达1100多公里。和田玉的基本色调有白色、黄色、青色和墨色，白色中质地细腻，光泽滋润，温滑如羊脂者，称为羊脂玉，是和田玉中最名贵的品种。 其他著名古代软玉产地还有辽宁岫岩、陕西蓝田和河南独山。辽宁岫岩细玉沟所产透闪石，俗称“岫岩老玉”，质地细腻，颜色有白、绿、黄绿等，新石器时代红山文化的许多玉器，就是利用这里的玉料制作的。岫岩和陕西蓝田还主要产蛇纹石玉。颜色常见是微带黄的浅绿色，也有豆绿色、黄绿色、白色、黄色、墨绿色。蓝田玉曾在汉唐时期被大量开采。独山是河南南阳市北郊的一座小孤山，著名的独山玉就产自这里。独山玉颜色比较复杂，有白、绿、黄、紫等色，质地细腻但不均匀，各色相互交错混杂。硬玉是辉石族钠辉石组中的一个矿物品种，半透明至微透明，颜色有绿、红、黄、白、紫等。硬玉又称翡翠，名称来源于翡翠鸟。这种鸟雄的羽毛红艳，称为翡鸟，雌的羽毛鲜翠，称为翠鸟，翡翠的主要颜色正合乎此鸟，因而名之。翡翠是现代人们喜爱的玉石品种，翠绿色玉是硬玉中最为宝贵者，它犹如雨洗冬青，凝翠欲滴，鲜亮清明，晶莹剔透，质地细腻。世界上90％的翡翠产于缅甸，清代乾隆时期才大量输入内地，制作的器型以龙形带钩、方牌、手镯、项链为主。 琢玉成器 俗话说：玉不琢不成器。早在史前时代，古人就已熟练地掌握了一套虽然原始简陋，却娴熟精湛的琢制玉器的技术。在考古发掘中，曾发现一些原始治玉工具，以及琢制玉器时废弃的边角料和留有加工痕迹的玉器成品，使我们可以循序复原出比较接近当时治玉的真实工艺过程。据推测，当时的治玉工序分为采玉、开眼、解玉、钻孔、打磨、镂刻、抛光等。 中国玉器的制作工艺，直到近代都是在手工业作坊中进行的。从明清时期玉业来看，其工艺流程大致分为5个步骤。 第一步是开玉，即将玉料外包裹的粗松的石面削掉，切削的主要工具是条锯。锯割时，要掺加水和颗粒细碎均匀的石砂（即解玉砂），以降低摩擦产生的热和增加摩擦系数。 第二步是在车床上将玉料琢制出器物的大致轮廓。加工玉料的车床叫“旋车”，上面安置“扎石呙”（圆形薄钢盘）、“冲石呙”（圆形钢圈）和“磨石呙”（圆形厚钢盘），先将玉料切成方块或方条，然后冲去棱角，最后再磨细器物表面。 第三步是将已经雕琢好外形的玉器，掏空它们的内膛，形成内空的空器，使用的工具是钢卷筒和一端套着弯钩的铁轴。对于一些小物件，如鼻烟壶、搬指、烟袋等，掏空时需要特别娴熟的技巧。 第四步是在玉器的外表雕琢各种花纹，使用的工具类似钉子形状，主要琢刻阴线条。雕琢镂空的花纹需要打钻，使用的工具是弯弓和金刚钻，金刚钻的硬度是10度，可以刻动所有的矿物。琢刻透雕图案时，用钢丝伸入已钻好的孔眼内，按照玉片上画好的线条来切割。 第五步是把已雕琢好的玉器外表，仔细地磨光。先用木制圆盘外包上牛皮（称“皮石呙”），配上似沙土的“宝料”，做最后的磨光。 每当我们欣赏远古精美的玉器时，在赞叹之余，都会想到一个令人困惑的问题：几千年前古人是用什么工具来琢治玉器的？史前时期，生产技术水平十分低下，人们使用的生产工具是以石、木、骨、牙、角、蚌等天然质料和动物骨骼制成的，其坚硬程度远不及青铜和铁器，用它们来琢治硬度较大的玉器显然是相当费力的。','2017-08-13 08:25:39',NULL,NULL);
